#Importing libraries and packages
import pandas as pd
import seaborn as sns
import matplotlib.pyplot as plt
from sklearn.preprocessing import LabelEncoder
from sklearn.model_selection import train_test_split
from sklearn.ensemble import RandomForestClassifier
from sklearn.metrics import accuracy_score
from sklearn.metrics import confusion_matrix, ConfusionMatrixDisplay
import warnings
warnings.filterwarnings("ignore")

# Importing dataset and checking first lines
data = pd.read_csv('/content/Churn Modeling.csv')
data.set_index('RowNumber', inplace=True)
data.head()

# Checking dataset information
data.info()

# Calculating dropout rate
churn = data.Exited.sum() / 10000* 100
print('%.2f' % churn, '%')

# Descriptive statistics of variables
data.describe()

# checking the total number of customers who closed the account
data['Exited'].value_counts()
sns.countplot(data['Exited'])

# Checking customer evasion by country
data['Geography'].value_counts()
grafico = [sns.barplot(x=data.Geography, y=data['Exited'])]

"""#**Data pre-processing**"""

# Transform categorical feature(s) to numeric
le = LabelEncoder()
data.Gender = le.fit_transform(data.Gender)
data.Geography = le.fit_transform(data.Geography)
data.Surname = le.fit_transform(data.Surname)

# Explore correlations to label
data.corr().Exited.sort_values(ascending=False)

# Explore correlations visually
f, ax = plt.subplots(figsize=(12,6))
sns.heatmap(data.corr(), annot=True, fmt='.2f')

# Split data into 80% train and 20% validation
X = data.drop('Exited', axis=1)
y = data['Exited']

X_train, X_val, y_train, y_val = train_test_split(X, y, test_size=0.2, random_state=7)

"""#**Building predictive machine and evaluating model**"""

# Build and train the model
model = RandomForestClassifier().fit(X_train,y_train)
model

# Model score on test data
result = model.score(X_val, y_val)
print("Acur√°cia nos Dados de Teste: %.3f%%" % (result * 100.0))

# Apply model to validation data
y_predict = model.predict(X_val)
print('Confusion Matrix: \n', confusion_matrix(y_val, y_predict,))

cm = confusion_matrix(y_val, y_predict, normalize='all')
cmd = ConfusionMatrixDisplay(cm, display_labels=['Saiu','N√£o saiu'])
cmd.plot()

# Compare actual and predicted values
actual_vs_predict = pd.DataFrame({'Gabarito(valor real)': y_val,
                                'Previs√£o_M√°quina_Preditiva': y_predict})
actual_vs_predict.sample(10)

# plot feature importance
plt.barh(model.feature_names_in_, model.feature_importances_)
